import React, { Component } from 'react';
import { DetailWrapper,Header,Content} from './style';
class Detail extends Component{
    render() {
        return(
        <DetailWrapper>
                <Header>一树花开</Header>
                <Content>
                    <img src='//upload-images.jianshu.io/upload_images/9693047-c2870bea58886c88?imageMogr2/auto-orient/strip%7CimageView2/2/w/640'/>
                </Content>
        </DetailWrapper>
        )
    }
}
export default Detail;
